window.bookSummaryJSON = "<p>The epic third story in the #1 New York Times bestselling Court of Thorns and Roses series by Sarah J. Maas.<br> <br> Feyre has returned to the Spring Court, determined to gather information on Tamlin's actions and learn what she can about the invading king threatening to bring her land to its knees. But to do so she must play a deadly game of deceit. One slip could bring doom not only for Feyre, but for everything-and everyone-she holds dear.<br> <br> As war bears down upon them all, Feyre endeavors to take her place amongst the High Fae of the land, balancing her struggle to master her powers-both magical and political-and her love for her court and family. Amidst these struggles, Feyre and Rhysand must decide whom to trust amongst the cunning and lethal High Lords, and hunt for allies in unexpected places.<br> <br> In this thrilling third audiobook in the #1 New York Times bestselling series from Sarah J. Maas, the fate of Feyre's world is at stake as armies grapple for power over the one thing that could destroy it.<br> <br> Performed by Melody Muze, Anthony Palmini, Natalie Van Sistine, Amanda Forstrom, Jon Vertullo, Danny Gavigan, Gabriel Michael, Shawn K. Jain, Holly Adams, Karenna Foley, Matthew Bassett, Henry W. Kramer, Nora Achrati, Cody Roberts, Dan Delgado, Brandon Burton, David Cui Cui, Marni Penning, Joey Sourlis, Mike Carnes, Donald Guzzi, Andrew Mimms, Sura Siu, Julienne Irons, Alex Hill-Knight, Ryan Carlo Dalusung, Yasmin Tuazon, Trei Taylor, and Michael John Casey.</p>"; 
